import React from "react";

const MainCard = () => {
    return (
        <>
            <div c="container">
                <div class="row">
                    <div class="col-sm-6 col-md-4">
                        <div c="card" style={{ width: "18rem" }}>
                            <img src="..." c="card-img-top" alt="..." />
                            <div c="card-body">
                                <h5 c="card-title">Card title</h5>
                                <p c="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                <a href="#" c="btn btn-primary">Go somewhere</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
};


export default MainCard;
